INSERT INTO `tbl_ht_trek_type` VALUES (1,'India','Himanchal Pradesh','Kasol-Keerganga','<p><b>Trip Location:</b><span> Kheerganga <br></span><b><br></b>- A 2 days 1 night Pawna Lake Camping on the banks of the beautiful Pawna Lake is here. Take part in this adventure to escape from the hassles of your city life.<br>- The lake is one of the popular artificial lakes located 10 kilometres away from Kamshet on the old Mumbai- Pune highway. It is a place known for nature, lake and green hills all together.<br>- Pawna Camping has become an important campsite after the construction of the Pawna Dam.<br><br></p>','2020-06-06 15:38:06','2020-06-06 15:38:06',NULL),(2,'India','Himanchal Pradesh','Kullu','<p><b>Trip Location:</b><span> Kheerganga <br></span><b><br></b>- A 2 days 1 night Pawna Lake Camping on the banks of the beautiful Pawna Lake is here. Take part in this adventure to escape from the hassles of your city life.<br>- The lake is one of the popular artificial lakes located 10 kilometres away from Kamshet on the old Mumbai- Pune highway. It is a place known for nature, lake and green hills all together.<br>- Pawna Camping has become an important campsite after the construction of the Pawna Dam.<br><br></p>','2020-06-06 15:38:06','2020-06-06 15:38:06',NULL);
